const o="ຕົກລົງ",e="ເລືອກທີ່ຢູ່ເພື່ອຮັບຫຼຽນກັບ",t="ໃຊ້ໄດ້",c="ສ້າງສັນຍາໃຫມ່ຕະຫຼອດເວລາ",s="ປີ",n="ສະຫນັບສະຫນູນຄວາມຊົ່ວຊ້າຂອງທ່ານ.",r="ອອກອາກາດສັນຍາເຮັດສັນຍາລ່ວງຫນ້າຂອງທ່ານ.",a="ສ້າງສັນຍາທີ່ຈະແຈກຢາຍປະມານຫນຶ່ງສ່ວນຮ້ອຍຂອງຍອດເງິນໃນປະຈໍາເດືອນໃນຄວາມຫວັງ.",l="ເດືອນ",h="ກະລຸນາໃສ່ທີ່ຢູ່ຂອງທ່ານ.",i="lo",v={0:"ໃຫ້ຂອງສ້າງກະແສການຈ່າຍເງິນເດືອນ.",1:"ຮຽນຮູ້ກ່ຽວກັບຫຼຽນຂອງພວກເຮົາ. ແຕະເພື່ອເບິ່ງ webcomic ຂອງ Webcomaper ຕົ້ນສະບັບ.",2:"ເວລາລັອກກະຕຸກ. ກະແຈປົດລັອກກະເປົາເງິນ.",3:"ເລືອກກະເປົາເງິນຂອງທ່ານ Bitcoin (BCH) ຢູ່ຂ້າງເທິງ.",4:"ຊອກຫາແລະສໍາຮອງກະແຈຂອງກະເປົາຂອງທ່ານ.",5:"ຫຼັງຈາກນັ້ນສ້າງສໍາຮອງຂໍ້ມູນອື່ນ",6:"ຫຼັກການຄວບຄຸມຫຼຽນ; ບໍ່ມີຄີ, ບໍ່ມີຫຼຽນ.",7:"ຄັດລອກທີ່ຢູ່ຈາກກະເປົາເງິນຂອງທ່ານ.",8:"ວາງທີ່ຢູ່ຂອງທ່ານໃນຫນ້າຈໍເຮືອນ.",9:"ບັນທຶກຄວາມຫວັງຂອງທ່ານໃນ blockchain.",10:"ທົບທວນຕາຕະລາງການຈ່າຍເງິນ.",11:"ສໍາເນົາທີ່ຢູ່ທາງຫນ້າຂອງທ່ານ.",12:"ສະຫນັບສະຫນູນການລ່ວງລະເມີດຂອງທ່ານໂດຍກົງ, ຫຼືແບ່ງປັນ.",13:"ນັ້ນແມ່ນມັນ, ທ່ານໄດ້ເຮັດມັນແລ້ວ. ທ່ານໄດ້ຊະນະ!",14:"ທ່ານໄດ້ຮັບໄຊຊະນະບາງຢ່າງເພື່ອຮຽນຮູ້,",15:"... ຫລືເປັນ",16:"ລາຍໄດ້ເປັນປົກກະຕິແມ່ນເສັ້ນທາງສູ່ເຮືອນ.",17:"ອົງການສາມາດສ້າງຄວາມເຂັ້ມແຂງໃຫ້ຄົນອື່ນ.",18:"ຢ່າໃຫ້ອໍານາດຂອງທ່ານໄປ,",19:"... ແຕ່ດັດແກ້ແຜນການຂອງທ່ານ, ເມື່ອຈໍາເປັນ.",20:"ຊອກຫາການປຽບທຽບຕົ້ນໄມ້ຂອງທ່ານເອງ.",21:"ດໍາລົງຊີວິດຍືນຍາວ",22:"ແລະຈະເລີນຮຸ່ງເຮືອງ.",23:"",24:"",25:"",26:"",ok:o,receive:e,spendable:t,create:c,year:s,short_02:n,short_01:r,overview:a,month:l,short_00:h,locale:i};export{c as create,v as default,i as locale,l as month,o as ok,a as overview,e as receive,h as short_00,r as short_01,n as short_02,t as spendable,s as year};
